import React, { useState } from "react";

import {
  MDBInput,
  MDBBtn,
  MDBContainer,
  MDBCol,
  MDBRow,
} from "mdb-react-ui-kit";
import { useNavigate } from "react-router-dom";
import axios from "axios";
import {
  Radio,
  FormControl,
  FormControlLabel,
  FormLabel,
  RadioGroup,
} from "@mui/material";

const Create = () => {
  const navigate = useNavigate();
  const [user, setUser] = useState({
    name: "",
    email: "",
    mobile: "",
    address: "",
    status: "",
  });
  const handleChange = (e) => {
    setUser({ ...user, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      if (
        !user.name ||
        !user.email ||
        !user.mobile ||
        !user.address ||
        !user.status
      ) {
        navigate("/submit");
      } else {
        await axios.post(`http://localhost:4000/users`, {
          name: user.name,
          email: user.email,
          mobile: user.mobile,
          address: user.address,
          status: user.status,
        });
      }
    } catch {
      console.log("Something is Went Wrong");
    }
    setUser({ name: "", email: "", mobile: "", address: "", status: "" });
  };
  return (
    <div>
      <MDBContainer>
        <form className=" form pt-4" onSubmit={handleSubmit}>
          <div className="name">
            <MDBRow size="12">
              <MDBCol size="3"></MDBCol>
              <MDBCol size="6">
                <div className="name">
                <h1> 1. What Is Your Name ?</h1>
                <MDBInput
                  name="name"
                  type="text"
                  wrapperClass="mb-4"
                  label="Name"
                  onChange={handleChange}
                />
                </div>
              </MDBCol>
            </MDBRow>
          </div>

          <div className="email">
            <MDBRow>
              <MDBCol size="3"></MDBCol>
              <MDBCol size="6">
                <h1> 2. What Is Your Email ?</h1>
                <MDBInput
                  name="email"
                  type="email"
                  wrapperClass="mb-4"
                  label="Email address"
                  onChange={handleChange}
                />
              </MDBCol>
            </MDBRow>
          </div>

          <div className="mobile">
            <MDBRow>
              <MDBCol size="3"></MDBCol>
              <MDBCol size="6">
                <h1>What is Your Phone</h1>
                <MDBInput
                  name="mobile"
                  type="tel"
                  wrapperClass="mb-4"
                  label="Phone"
                  onChange={handleChange}
                />
              </MDBCol>
            </MDBRow>
          </div>

          <div className="address">
            <MDBRow>
              <MDBCol size="3"></MDBCol>
              <MDBCol size="6">
                <h1>What is your Address</h1>
                <MDBInput
                  name="address"
                  type="text"
                  wrapperClass="mb-4"
                  label="Address"
                  onChange={handleChange}
                />
              </MDBCol>
            </MDBRow>
          </div>

          <div className="status">
            <MDBRow>
              <MDBCol size="3"></MDBCol>
              <MDBCol size="6">
                <h1> What is Your Status</h1>
                <FormControl>
                  <FormLabel id="demo-controlled-radio-buttons-group">
                    Status
                  </FormLabel>
                  <RadioGroup
                    aria-labelledby="demo-controlled-radio-buttons-group"
                    name="status"
                    onChange={handleChange}
                  >
                    <FormControlLabel
                      value="Active"
                      control={<Radio />}
                      label="Active"
                    />
                    <FormControlLabel
                      value="Inactive"
                      control={<Radio />}
                      label="Inactive"
                    />
                  </RadioGroup>
                </FormControl>
              </MDBCol>
            </MDBRow>
          </div>

          <div className="button">
            <MDBRow>
              <MDBCol size="3"></MDBCol>
              <MDBCol size="6">
                <MDBBtn type="submit" className="mb-4" block color="success">
                  Add User
                </MDBBtn>
              </MDBCol>
            </MDBRow>
          </div>
        </form>
      </MDBContainer>
    </div>
  );
};

export default Create;
